      color: '#3b82f6',
      backgroundColor: 'white',
      display: 'flex',
      alignItems: 'center',
      cursor: 'pointer',
    },
    expertBtn: {
      padding: '8px 15px',
      border: '1px solid #3b82f6',
      borderRadius: '20px',
      color: '#3b82f6',
      backgroundColor: 'white',
      display: 'flex',
      alignItems: 'center',
      cursor: 'pointer',
    },
    headline: {
      fontSize: '24px',
      margin: '30px 0 15px 0',
      textAlign: 'center',
    },
    amount: {
      color: '#3b82f6',
      fontWeight: 'bold',
    },
    price: {
      color: '#3b82f6',
      fontWeight: 'bold',
    },
    offerSection: {
      display: 'flex',
      justifyContent: 'center',
      gap: '20px',
      margin: '20px 0',
    },
    offer: {
      display: 'flex',
      alignItems: 'center',
      backgroundColor: '#f0ffee',
      padding: '8px 15px',
      borderRadius: '5px',
      fontSize: '14px',
    },
    offerIcon: {
      color: 'green',
      marginRight: '8px',
    },
    offerText: {
      color: 'green',
    },
    genderSelector: {
      display: 'flex',
      justifyContent: 'center',
      gap: '10px',
      margin: '20px 0',
    },
    genderBtn: {
      padding: '10px 40px',
      borderRadius: '5px',
      border: 'none',
      cursor: 'pointer',
    },
    genderBtnActive: {
      backgroundColor: '#3b82f6',
      color: 'white',
    },
    genderBtnInactive: {
      backgroundColor: 'white',
      color: '#333',
    },
    formControl: {
      marginBottom: '20px',
    },
    label: {
      display: 'block',
      fontSize: '14px',
      color: '#555',
      marginBottom: '5px',
    },
    input: {
      width: '100%',
      padding: '12px',
      border: '1px solid #ddd',
      borderRadius: '5px',
      fontSize: '16px',
    },
    phoneInput: {
      display: 'flex',
    },
    countrySelect: {
      width: '30%',
      padding: '12px',
      border: '1px solid #ddd',
      borderRadius: '5px 0 0 5px',
      borderRight: 'none',
    },
    phoneCode: {
      width: '15%',
      padding: '12px',
      border: '1px solid #ddd',
      borderLeft: 'none',
      borderRight: 'none',
      backgroundColor: '#f9f9f9',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    },
    phoneNumber: {
      width: '55%',
      padding: '12px',
      border: '1px solid #ddd',
      borderRadius: '0 5px 5px 0',
      borderLeft: 'none',
    },
    viewPlansBtn: {
      width: '100%',
      padding: '15px',
      backgroundColor: '#e95420',
      color: 'white',
      border: 'none',
      borderRadius: '5px',
      fontSize: '16px',
      fontWeight: 'bold',
      cursor: 'pointer',
    },
    certifiedSection: {
      textAlign: 'center',
      margin: '20px 0',
      fontSize: '14px',
      color: '#555',
    },
    whatsappSection: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '10px',
      margin: '15px 0',
    },
    toggleSwitch: {
      position: 'relative',
      display: 'inline-block',
      width: '40px',
      height: '20px',
    },
    toggleInput: {
      opacity: 0,
      width: 0,
      height: 0,
