      fontSize: '12px',
      color: '#777',
      margin: '15px 0',
    },
    link: {
      color: '#3b82f6',
      textDecoration: 'underline',
    },
    statsSection: {
      backgroundColor: 'white',
      padding: '20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      margin: '30px 0',
      borderRadius: '5px',
    },
    companyInfo: {
      flex: '1',
    },
    stars: {
      color: '#ffc107',
      fontSize: '24px',
      display: 'flex',
    },
    statGroup: {
      textAlign: 'center',
      padding: '0 15px',
    },
    statValue: {
      color: '#3b82f6',
      fontSize: '24px',
      fontWeight: 'bold',
    },
    statLabel: {
      fontSize: '12px',
      color: '#777',
    },
    ageDisplay: {
      backgroundColor: '#f0f2f5',
      padding: '8px 12px',
      borderRadius: '5px',
      fontSize: '14px',
      marginLeft: '10px',
    },
    dobContainer: {
      display: 'flex',
      alignItems: 'center',
    }
  };

  return (
    <div style={formStyles.container}>
      <div style={formStyles.header}>
        <div style={formStyles.logoContainer}>
          <img 
            src="https://via.placeholder.com/150x40?text=PolicyBazaar" 
            alt="PolicyBazaar Logo" 
            style={formStyles.logo} 
